text:
october 31st is an amazing day, not just because its halloween, but because it was the last time i laid underneath a real life monster. i was molested for many years of my young life. yet, 10/31/18 marks 5 years on the calander. many might disagree on my celebration of this day. let me explain a little of what everyday was like;

you weren't there everyday.  you weren't there as he  called my mother worthless, stupid,& incompetent. you weren't there when he went on a vacation leaving his two young children to care for his wife after her brain surgery. you weren't there when he would pin my sister against walls. you weren't there when you were called fat, and spit on. you weren't there when he screamed at me calling me an ungrateful bitch. you weren't there when he complained about his sex life to me, as his child. you weren't there everyday, waiting for the explosion. you weren't there caring for your mom, at 9 years old as he cheated on her. you weren't there holding your mom as she cried wishing she could leave him. you weren't there taking the abuse away from your siblings so they wouldn't have to experience it, only to be  exiled later in life by them. everyday was a battle, everyday i begged i would die. everyday as the threats became reality, and the bruises wouldn't fade. 
the answer is yes, i celebrate the last day i ever had to suffer through within under the same roof. i celebrate a victory dance of surviving 13 years of that, despite almost being killed multiple times. you may not understand it, but you dont understand what it was like.

