text:
my newest blog post touches on some of the trauma i've had so far in my life. i write because i want to empower and help other people who have been dealt a crappy hand in life. one thing i stress in there is that sometimes your parents can't save you and it's not their fault. now that i'm an adult it's time i dealt with it all like one. so i'm currently looking for therapy. it wasn't easy writing this blog but i think i needed to do it. it may trigger some people so please be careful. also, i'm not asking for sympathy, just strength and support. 
link for my blog is in my bio. 
