text:
pujolicuous!! red and white are two authentic puja colors.. somehow they do bring out the best in you during the festivals. it was kojagori lokkhi pujo and i wore this red soft khadi  in jacquard pattern with weaved sequins and large pompoms. this is from the loved @amrapaliboutique.

and with this starts the wait for diwali ❤️❤️ this is also my entry for the selfie queen challenge by @saree.man
. selfie is all about self love. self love is very misunderstood term. as i have mentioned in many of my earlier posts that it's most important to accept and love self as that gives you the way to accept and love others as they are. as you don't wanna change you will not want to change others too. the more you understand yourself and your needs the more you grow and  understand others. it's never right or wrong it's always situations. with #metoo campaign going on we all know how important it is that we speak for ourselves. as women we are taught to be selfless and we contradict ourselves the most by not showing some love to our own wishes. we should be selfless, self dependent and do what we want sometimes too because we are not dependent on anyone for love we have immense positivity in ourselves . we can find peace in ourselves  too. selfie is capturing your moments with  yourself. i have travelled alone quite a few times and selfies are the way to capture those beautiful pictures and enjoy.

most of my posts have the first picture as my selfie or at least one selfie for sure because in morning while i leave for work there is no one and thats when u look fresh, so u end up taking a selfie. and to be honest i feel i know from which angle i will look better 😜🙈🙊 tagging the selfie queens in my life @sparshibanerjee(loves selfies)
@snap_shots_ofmylife(loves selfies)
@pooja_nghosh (visit her page and u would know)
@ayushi.2406 (she is the queen of selfies)
@lotusseal_yoga (she takes all her videos by herself)
to participate #socialsaree #sareeselfiequeen
